import {Col} from 'antd';
import React from 'react';
import { WapperHeader } from './style';

const HeaderComponent = () => {
    return(
        <div>
            <WapperHeader>
                <Col span={6}></Col>
                <Col span={12}></Col>
                <Col span={6}></Col>
            </WapperHeader>
        </div>
    )
}

export default HeaderComponent;
